import Item from './Item'


export default class App extends Component {

    handelChange (event) {
        console.log(event.target.value);
    }
  render() {
    return (
      <div>
          <div>
            <input type="text" onChange={this.handelChange}/>
            <button>增加</button>
          </div>
          <Item/>
      </div>
    )
  }
}
